import React, { useState } from 'react';

function Contact() {
  const [form, setForm] = useState({ name: '', email: '', message: '' });
  const [submitted, setSubmitted] = useState(false);

  const handleChange = e => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = e => {
    e.preventDefault();
    setSubmitted(true);
    // Placeholder for form submission logic
  };

  return (
    <div style={{ background: '#F5F5F5', minHeight: '100vh', padding: '0 0 2rem 0' }}>
      <section className="responsive-section responsive-flex" style={{
        maxWidth: '1000px',
        margin: '0 auto',
        padding: '3rem 1rem',
        display: 'flex',
        flexWrap: 'wrap',
        gap: '2.5rem',
        justifyContent: 'center',
      }}>
        {/* Contact Info */}
        <div className="responsive-card" style={{ flex: '1 1 300px', minWidth: '260px', maxWidth: '340px', background: '#fff', borderRadius: '1.2rem', boxShadow: '0 2px 12px rgba(0,0,0,0.06)', padding: '2.2rem 1.5rem', marginBottom: '1rem', display: 'flex', flexDirection: 'column', gap: '1.2rem', justifyContent: 'space-between' }}>
          <div>
            <h2 style={{ color: '#0057D9', fontWeight: 700, fontSize: '1.4rem', marginBottom: '1.2rem' }}>Contact Information</h2>
            <div style={{ color: '#2E2E2E', marginBottom: '1rem' }}>
              <span style={{ color: '#2ECC71', fontWeight: 700 }}>Address:</span><br />
              Roorkee, Uttarakhand, INDIA
            </div>
            <div style={{ color: '#2E2E2E', marginBottom: '1rem' }}>
              <span style={{ color: '#2ECC71', fontWeight: 700 }}>Phone:</span><br />
              <a href="tel:+919027880288" style={{ color: '#0057D9', textDecoration: 'none', fontWeight: 600 }}>+91 9027880288</a>
            </div>
            <div style={{ color: '#2E2E2E' }}>
              <span style={{ color: '#2ECC71', fontWeight: 700 }}>Email:</span><br />
              <a href="mailto:official.customweb@gmail.com" style={{ color: '#0057D9', textDecoration: 'none', fontWeight: 600 }}>official.customweb@gmail.com</a>
            </div>
          </div>
          <div style={{ borderRadius: '0.7rem', overflow: 'hidden', marginTop: '1.2rem', boxShadow: '0 2px 8px rgba(0,87,217,0.08)' }}>
            <iframe
              title="Custom Web Location"
              src="https://www.google.com/maps?q=Roorkee,+Uttarakhand,+India&output=embed"
              width="100%"
              height="140"
              style={{ border: 0 }}
              allowFullScreen=""
              loading="lazy"
              referrerPolicy="no-referrer-when-downgrade"
            ></iframe>
          </div>
        </div>
        {/* Contact Form */}
        <form className="responsive-card" onSubmit={handleSubmit} style={{ flex: '1 1 350px', minWidth: '260px', maxWidth: '420px', background: '#fff', borderRadius: '1.2rem', boxShadow: '0 2px 12px rgba(0,0,0,0.06)', padding: '2.2rem 1.5rem', display: 'flex', flexDirection: 'column', gap: '1.2rem', border: submitted ? '2px solid #2ECC71' : '2px solid transparent', transition: 'border 0.2s' }}>
          <h2 style={{ color: '#0057D9', fontWeight: 700, fontSize: '1.4rem', marginBottom: '1rem' }}>Send Us a Message</h2>
          <input
            type="text"
            name="name"
            placeholder="Your Name"
            value={form.name}
            onChange={handleChange}
            required
            style={{ padding: '0.8rem', borderRadius: '0.5rem', border: '1px solid #ddd', fontSize: '1rem' }}
          />
          <input
            type="email"
            name="email"
            placeholder="Your Email"
            value={form.email}
            onChange={handleChange}
            required
            style={{ padding: '0.8rem', borderRadius: '0.5rem', border: '1px solid #ddd', fontSize: '1rem' }}
          />
          <textarea
            name="message"
            placeholder="Your Message"
            value={form.message}
            onChange={handleChange}
            required
            rows={5}
            style={{ padding: '0.8rem', borderRadius: '0.5rem', border: '1px solid #ddd', fontSize: '1rem', resize: 'vertical' }}
          />
          <button type="submit" style={{
            background: '#0057D9',
            color: '#fff',
            border: 'none',
            borderRadius: '2rem',
            padding: '0.8rem 2.2rem',
            fontWeight: 700,
            fontSize: '1.1rem',
            cursor: 'pointer',
            boxShadow: '0 2px 8px rgba(0,0,0,0.10)',
            transition: 'background 0.2s',
          }}
            onMouseOver={e => e.target.style.background = '#2ECC71'}
            onMouseOut={e => e.target.style.background = '#0057D9'}
          >Send Message</button>
          {submitted && <div style={{ color: '#2ECC71', textAlign: 'center', marginTop: '0.5rem', fontWeight: 600, fontSize: '1.1rem' }}>Thank you for contacting us! We will get back to you soon.</div>}
        </form>
      </section>
    </div>
  );
}

export default Contact;
